--Creacion de la tabla cliente
CREATE TABLE cliente (
    nombrecliente character varying(50),
    direccion character varying(100),
    estado character varying(30)
);

--Creacion de la tabla sucursal
CREATE TABLE sucursal (
    nombresucursal character varying(30),
    estado character varying(30),
    activo integer
);

--Creacion de la tabla ctaCliente
CREATE TABLE ctacliente (
    nombrecliente character varying(50),
    numcta character(6)
);

--Creacion de la tabla cuenta
CREATE TABLE cuenta (
    nombresucursal character varying(30),
    numcta character(6),
    saldo integer
);

--Creacion de la tabla prestatario
CREATE TABLE prestatario (
    nombrecliente character varying(50),
    numprestamo character(6)
);

--Creacion de la tabla prestamo
CREATE TABLE prestamo (
    nombresucursal character varying(30),
    numprestamo character(6),
    importe integer
);

